import styled from "styled-components";

const Container = styled.section`
    display: flex;
    width: 100vw;
    align-items: center;
    font-family: "Josefin Sans", sans-serif;
    position: sticky;
    top: 0;
    z-index: 999;
    height: 3.125rem;

`;

const TopLeft = styled.article`
    flex:1
`;

const TopCenter = styled.article`
    flex:2
`;

const TopRight = styled.article`
    flex:1
`;

const TopBar = () => {
  return (
    <Container>
        <TopLeft>left</TopLeft>
        <TopCenter>Center</TopCenter>
        <TopRight>Right</TopRight>
    </Container>
  )
}

export default TopBar
